import React, { Component } from "react";

const Tasks = ({todos , setTodos}) =>{


    return(
      <div>
          {todos.map}
             <div class="task">
          <span class="icon-star icon" 
      > </span>
          <p  class="task-text"></p>
    
          <div>
            <span class="icon-trash icon" 
            > </span>
    
            <span className="icon-file_done icon" > </span>
          </div> 
         </div>
      </div>
      
    );
   
}

export default Tasks
